import React from 'react';
import './Display.css'



const Display = ({people}) => {
    //console.log(props);

    let {name,age,job} = props
    return(
        <div className='person'>
            <h1>
                name:{name}
            </h1>
            <h2>
                age:{age}
            </h2>
            <h3>
                job:{job}
            </h3>
        </div>
    );
}

export default Display;
